    const searchParams = new URLSearchParams({
      q: query,
      per_page: per_page.toString(),
      page: page.toString(),
      sort: "followers",
      order: "desc"
    });
    const response = await fetch(`${this.baseUrl}/search/users?${searchParams}`);
